import React, { useEffect, useState } from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
import Home from "./Home";
import Navbar from "./Navbar";

function App() {
    return(
        <div style>
            <Navbar />
            <Router>
                <Route exact path="/Home">
                    <Home />
                </Route>
            </Router>
        </div>
    )
}

export default App;
